import Navbar from './Components/Navbar';
import About from "./Components/About";
import Login from "./Components/login";
import Profile from "./Components/Profile";
import Dalle from "./Components/Dalle";
import Neural from "./Components/Neural";
import Dream from "./Components/Dream";
import { useState, useEffect } from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
  const [login, setLogin] = useState(false);
  const [username, setUsername] = useState("");

  useEffect(() => {
    const storedLogin = localStorage.getItem("login");
    const storedUsername = localStorage.getItem("username");
    if (storedLogin === "true" && storedUsername) {
      setLogin(true);
      setUsername(storedUsername);
    }
  }, []);

  const userid = (name) => {
    setUsername(name);
    localStorage.setItem("username", name);
  };

  const handleLogin = () => {
    setLogin(true);
    localStorage.setItem("login", "true");
  };

  const handleLogout = () => {
    setLogin(false);
    setUsername("");
    localStorage.removeItem("login");
    localStorage.removeItem("username");
  };

  return (
    <>
      <BrowserRouter>
        {login && <Navbar handleLogout={handleLogout} />}
        <Routes>
          {login ?
            <>
              <Route exact path='/' element={<About />} />
              <Route exact path='/Generation' element={<Dalle />} />
              <Route exact path='/Creativity' element={<Neural user={username} />} />
              <Route exact path='/Dreaming' element={<Dream user={username} />} />
              <Route exact path='/Profile' element={<Profile user={username} loggedout={handleLogout} />} />
            </>
            :
            <Route exact path='*' element={<Login handleLogin={handleLogin} userid={userid} />} />
          }
        </Routes>
      </BrowserRouter>
    </>
  );
}

export default App;
